import React from 'react';

const DashboardPage = () => {
  return (
    <div className="p-4">
      <h2 className="text-2xl mb-4">Dashboard</h2>
      <p>Welcome to the Dashboard!</p>
    </div>
  );
};

export default DashboardPage;
